  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seedskadee
  NWR outlines Refuge accomplishments during the 1975 fiscal year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments. Resource management is outlined; topics include grazing.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, and safety. N-R forms and photographs are attached.\",\n\t\"owner_org\":
